  <!-- Sezione navbar -->
  <nav class="navbar">
    <div class="container flex-row">
      <div class="col-6">
        <h2>TheCocktailDB</h2>
      </div>
      <div class="col-6">
        <div class="row flex-direction-end">
          <div class="col-4 p-0">
